func lengthOfLongestSubstring(s string) int {
	if s == "" {
		return 0
	}
	currMap := make(map[string]int, len(s))
	max, lastMax := 0, 0
	begin := 0
	for i := 0; i < len(s); i++ {
		if exist, ok := currMap[string(s[i])]; ok && exist >= begin {
			if lastMax > max {
				max = lastMax
			}
			lastMax = lastMax - (exist - begin + 1)
			begin = exist + 1
		}
		currMap[string(s[i])] = i
		lastMax++
	}
	if lastMax > max {
		max = lastMax
	}
	return max
}

